import React, { Component } from 'react';
import axios from 'axios'
import "bootstrap/dist/css/bootstrap.min.css";
import { Link, Router } from 'react-router-dom';

class Mealplans extends Component {
    constructor(props){
        super(props)
        this.state = {
            mealplans: axios.get('http://localhost:5000/mealplan'),
            mealplanListGroup: mealplans.map(mealplan => 
            <li><Link to="" class="list-group-item list-group-item-action">{mealplan[monday][name]}</Link></li>)
        }
    }
        
    render() {
        return (
            <Router>
                <div class="list-group">
                    {this.state.mealplanListGroup}
                </div>
            </Router>
            
        )
    }
}

export default Mealplans
